import { FormControlLabel, ListItemButton, ListItemIcon } from '@mui/material';
import { CheckBox } from '@material-ui/icons';
import { styled } from '@mui/system';

const StyledCheckBox = styled(CheckBox)(({ theme }) => ({
  '&$checked': {
    color: 'purple',
  },
  checked: {},
}));

const CheckedboxProton = ({ age, changeChecked }) => {
  const label = age.label;
  const checked = age.checked;
  const id = age.id;

  const classes = {
    label: {
      fontSize: '.8rem',
      fontFamily: 'Raleway',
    },
    wrap: {
      width: '100%',
      display: 'flex',
      flexDirection: 'row-reverse',
      justifyContent: 'space-between',
      alignItems: 'center',
      marginLeft: 0,
    },
  };

  return (
    <div>
      <FormControlLabel
        classes={{
          label: classes.label,
          root: classes.wrap,
        }}
        control={
          <StyledCheckBox
            size="small"
            checked={checked}
            onChange={() => changeChecked(id)}
            color="secondary"
          />
        }
        label={label}
      />
    </div>
  );
};

export default CheckedboxProton;
